(61,'사내 휴가 정책을 알고 싶어요.','죄송합니다. 질문을 이해하지 못했습니다. 다른 방식으로 질문해 주시겠어요?',NULL,NULL,'gpt',NULL,'2025-06-09 09:47:30','2025-06-09 09:47:30','{\"status\": \"success\", \"data\": {\"response\": \"죄송합니다. 질문을 이해하지 못했습니다. 다른 방식으로 질문해 주시겠어요?\", \"response_type\": \"gpt\", \"route_code\": null, \"route_name\": null, \"route_path\": null, \"route_type\": null}}'),
(62,'사내 휴가 정책을 알고 싶어요.','영우랩스의 사내 휴가 정책은 다음과 같습니다:\n- 일반 연차 휴가는 미리 인사팀에 신청하여 승인을 받아야 합니다.\n- 특별휴가는 결혼, 출산, 장례 등 특별한 사유에 해당되며, 이러한 경우에만 인사팀 승인 후 사용 가능합니다.\n- 모든 휴가는 예약 시간을 준수해야 하며, 사용 후에는 정리정돈을 반드시 해야 합니다.\n- 출장비는 월말에 일괄 정산됩니다.\n\n더 자세한 정보나 규정에 대해 알고 싶다면, 인사팀에 문의하시거나 내부 업무 메뉴얼을 참조하시기 바랍니다.',NULL,NULL,'gpt',NULL,'2025-06-09 09:55:14','2025-06-09 09:55:14','{\"status\": \"success\", \"data\": {\"response\": \"영우랩스의 사내 휴가 정책은 다음과 같습니다:\\n- 일반 연차 휴가는 미리 인사팀에 신청하여 승인을 받아야 합니다.\\n- 특별휴가는 결혼, 출산, 장례 등 특별한 사유에 해당되며, 이러한 경우에만 인사팀 승인 후 사용 가능합니다.\\n- 모든 휴가는 예약 시간을 준수해야 하며, 사용 후에는 정리정돈을 반드시 해야 합니다.\\n- 출장비는 월말에 일괄 정산됩니다.\\n\\n더 자세한 정보나 규정에 대해 알고 싶다면, 인사팀에 문의하시거나 내부 업무 메뉴얼을 참조하시기 바랍니다.\", \"response_type\": \"gpt\", \"route_code\": null, \"route_name\": null, \"route_path\": null, \"route_type\": null}}'),
(63,'LG유플러스는 어떤 회사에요? ','LG유플러스는 LG그룹의 통신 사업 부문 중 하나로, 이동통신사 및 인터넷 서비스 제공업체입니다. 휴대전화, 브로드밴드 인터넷, IPTV 등 다양한 통신 서비스를 제공하고 있습니다. 또한, LG유플러스는 5G 기술을 선도하며 다양한 디지털 콘텐츠와 서비스를 제공하고 있습니다. LG유플러스의 공식 웹사이트나 관련된 보도자료를 참고하면 더 자세한 정보를 얻을 수 있습니다.',NULL,NULL,'gpt',NULL,'2025-06-09 09:57:04','2025-06-09 09:57:04','{\"status\": \"success\", \"data\": {\"response\": \"LG유플러스는 LG그룹의 통신 사업 부문 중 하나로, 이동통신사 및 인터넷 서비스 제공업체입니다. 휴대전화, 브로드밴드 인터넷, IPTV 등 다양한 통신 서비스를 제공하고 있습니다. 또한, LG유플러스는 5G 기술을 선도하며 다양한 디지털 콘텐츠와 서비스를 제공하고 있습니다. LG유플러스의 공식 웹사이트나 관련된 보도자료를 참고하면 더 자세한 정보를 얻을 수 있습니다.\", \"response_type\": \"gpt\", \"route_code\": null, \"route_name\": null, \"route_path\": null, \"route_type\": null}}'),
(64,'영우랩스의 사내 회의실 예약방법은 어떻게 되요?','영우랩스의 사내 회의실은 인트라넷을 통해 예약할 수 있습니다. 먼저 회사 내부 네트워크에 접속하여 예약 가능한 시간대를 확인하고, 해당 시간대에 예약을 진행하시면 됩니다. 만약 인트라넷을 통해 예약하는 방법에 대한 자세한 안내가 필요하시다면, IT 부서나 관리팀에 문의하시는 것이 좋습니다.',NULL,NULL,'gpt',NULL,'2025-06-09 09:58:56','2025-06-09 09:58:56','{\"status\": \"success\", \"data\": {\"response\": \"영우랩스의 사내 회의실은 인트라넷을 통해 예약할 수 있습니다. 먼저 회사 내부 네트워크에 접속하여 예약 가능한 시간대를 확인하고, 해당 시간대에 예약을 진행하시면 됩니다. 만약 인트라넷을 통해 예약하는 방법에 대한 자세한 안내가 필요하시다면, IT 부서나 관리팀에 문의하시는 것이 좋습니다.\", \"response_type\": \"gpt\", \"route_code\": null, \"route_name\": null, \"route_path\": null, \"route_type\": null}}'),
(65,'사내 동호회 지원은 어느범위까지 되나요?','영우랩스에서는 사내 동호회 활동비를 분기별로 지원합니다. 이는 사회공헌 활동을 통해 직원들의 활력을 유지하고 협업을 촉진하기 위한 것입니다. 사회공헌 활동은 연 2회 이상 실시되며, 열람이 필요한 경우에는 인사팀의 승인을 받아야 합니다. 동호회 지원 범위에 대한 구체적인 가이드라인은 별도로 제공되고 있으니, 필요하다면 해당 문서를 참조하시거나 인사팀과 상담해보시는 것이 좋습니다.',NULL,NULL,'gpt',NULL,'2025-06-09 10:00:20','2025-06-09 10:00:20','{\"status\": \"success\", \"data\": {\"response\": \"영우랩스에서는 사내 동호회 활동비를 분기별로 지원합니다. 이는 사회공헌 활동을 통해 직원들의 활력을 유지하고 협업을 촉진하기 위한 것입니다. 사회공헌 활동은 연 2회 이상 실시되며, 열람이 필요한 경우에는 인사팀의 승인을 받아야 합니다. 동호회 지원 범위에 대한 구체적인 가이드라인은 별도로 제공되고 있으니, 필요하다면 해당 문서를 참조하시거나 인사팀과 상담해보시는 것이 좋습니다.\", \"response_type\": \"gpt\", \"route_code\": null, \"route_name\": null, \"route_path\": null, \"route_type\": null}}'),
(66,'조정현 정보','조정현님의 정보입니다:\n직책: 대표이사\n부서: 경영지원\n이메일: amma76@ywlabs.com\n연락처: 010-1234-5678','employee_info',NULL,'dynamic',NULL,'2025-06-09 10:00:27','2025-06-09 10:00:27','{\"status\": \"success\", \"data\": {\"response\": \"조정현님의 정보입니다:\\n직책: 대표이사\\n부서: 경영지원\\n이메일: amma76@ywlabs.com\\n연락처: 010-1234-5678\", \"response_type\": \"dynamic\", \"employee\": {\"name\": \"조정현\", \"position\": \"대표이사\", \"dept_nm\": \"경영지원\", \"email\": \"amma76@ywlabs.com\", \"phone\": \"010-1234-5678\"}, \"route_code\": null, \"route_name\": null, \"route_path\": null, \"route_type\": null}}'),
(67,'영우랩스의 휴가 정책을 알고 싶어요.','영우랩스의 휴가 정책은 다음과 같습니다:\n- 연차 휴가는 년차별로 지정되며, 사용 후에는 정리정돈을 반드시 해야 합니다.\n- 예약 시간을 준수하여 휴가를 신청해야 합니다.\n- 출장비는 월말에 일괄 정산됩니다.\n- 동호회 활동비는 분기별로 지원됩니다.\n\n더 자세한 정보나 규정에 대한 문의가 있으시다면 인사팀에 문의하시거나 내부 가이드 라인을 참고하시기 바랍니다.',NULL,NULL,'gpt',NULL,'2025-06-09 10:01:40','2025-06-09 10:01:40','{\"status\": \"success\", \"data\": {\"response\": \"영우랩스의 휴가 정책은 다음과 같습니다:\\n- 연차 휴가는 년차별로 지정되며, 사용 후에는 정리정돈을 반드시 해야 합니다.\\n- 예약 시간을 준수하여 휴가를 신청해야 합니다.\\n- 출장비는 월말에 일괄 정산됩니다.\\n- 동호회 활동비는 분기별로 지원됩니다.\\n\\n더 자세한 정보나 규정에 대한 문의가 있으시다면 인사팀에 문의하시거나 내부 가이드 라인을 참고하시기 바랍니다.\", \"response_type\": \"gpt\", \"route_code\": null, \"route_name\": null, \"route_path\": null, \"route_type\": null}}'),
(68,'사내 식당 이용 방법은 어떻게 되나요?','사내 식당을 이용하려면 다음 단계를 따라야 합니다:\n1. 사내 식당 운영 시간 확인: 먼저 회사 내부에 위치한 식당의 운영 시간을 확인하세요.\n2. 메뉴 및 가격 확인: 식당에서 제공하는 메뉴와 가격을 살펴보고 원하는 음식을 선택하세요.\n3. 주문 방법: 주문은 현금 또는 식권 등 지정된 결제 수단을 사용하여 합니다.\n4. 일회용품 자제: 사내에서는 일회용품 사용을 최대한 자제해야 합니다. 재사용 가능한 용기나 수저를 사용하도록 노력하세요.\n\n만약 추가 정보가 필요하다면, 회사 내부 공지사항이나 관련 부서에 문의하여 자세한 안내를 받을 수 있습니다.',NULL,NULL,'gpt',NULL,'2025-06-09 10:02:47','2025-06-09 10:02:47','{\"status\": \"success\", \"data\": {\"response\": \"사내 식당을 이용하려면 다음 단계를 따라야 합니다:\\n1. 사내 식당 운영 시간 확인: 먼저 회사 내부에 위치한 식당의 운영 시간을 확인하세요.\\n2. 메뉴 및 가격 확인: 식당에서 제공하는 메뉴와 가격을 살펴보고 원하는 음식을 선택하세요.\\n3. 주문 방법: 주문은 현금 또는 식권 등 지정된 결제 수단을 사용하여 합니다.\\n4. 일회용품 자제: 사내에서는 일회용품 사용을 최대한 자제해야 합니다. 재사용 가능한 용기나 수저를 사용하도록 노력하세요.\\n\\n만약 추가 정보가 필요하다면, 회사 내부 공지사항이나 관련 부서에 문의하여 자세한 안내를 받을 수 있습니다.\", \"response_type\": \"gpt\", \"route_code\": null, \"route_name\": null, \"route_path\": null, \"route_type\": null}}'),
(69,'영우랩스의 사내복지제도는 어떻게 되나요?','- 영우랩스의 사내 복지 제도는 다음과 같습니다:\n    1. 복지포인트\n    2. 사내 기부금 관리\n    3. 사회공헌 활동\n\n| 항목              | 내용                                                                         |\n|-------------------|------------------------------------------------------------------------------|\n| 복지포인트        | 연 1회 지급되며, 사내 복지몰에서 사용 가능합니다.                            |\n| 사내 기부금 관리  | - 내용                                                                      |\n|                   | - 내용                                                                      |\n| 사회공헌 활동     | 연 2회 이상 실시합니다.                                                     |',NULL,NULL,'gpt',NULL,'2025-06-09 10:05:25','2025-06-09 10:05:25','{\"status\": \"success\", \"data\": {\"response\": \"- 영우랩스의 사내 복지 제도는 다음과 같습니다:\\n    1. 복지포인트\\n    2. 사내 기부금 관리\\n    3. 사회공헌 활동\\n\\n| 항목              | 내용                                                                         |\\n|-------------------|------------------------------------------------------------------------------|\\n| 복지포인트        | 연 1회 지급되며, 사내 복지몰에서 사용 가능합니다.                            |\\n| 사내 기부금 관리  | - 내용                                                                      |\\n|                   | - 내용                                                                      |\\n| 사회공헌 활동     | 연 2회 이상 실시합니다.                                                     |\", \"response_type\": \"gpt\", \"route_code\": null, \"route_name\": null, \"route_path\": null, \"route_type\": null}}'),
(70,'영우랩스 연차 규정은?','회사 소개 페이지로 이동하시겠습니까?','about','ABOUT','text',NULL,'2025-06-09 10:08:59','2025-06-09 10:08:59','{\"status\": \"success\", \"data\": {\"response\": \"회사 소개 페이지로 이동하시겠습니까?\", \"response_type\": \"text\", \"route_code\": \"ABOUT\", \"route_name\": \"회사 소개\", \"route_path\": \"/about\", \"route_type\": \"link\", \"response_params\": {}}}'),
