(98,'연차 사용 절차','1. 상사에게 연차 사용 계획을 미리 협의합니다.\n2. HR 시스템을 통해 연차를 신청합니다.\n3. 연차 사용 승인을 받습니다.\n4. 연차 사용 기간을 업무 담당자와 공유합니다.\n5. 사용한 연차 일수를 HR 시스템에 입력하고 완료 처리합니다.',NULL,NULL,'gpt',NULL,'2025-06-11 07:50:32','2025-06-11 07:50:32','{\"status\": \"success\", \"data\": {\"response\": \"1. 상사에게 연차 사용 계획을 미리 협의합니다.\\n2. HR 시스템을 통해 연차를 신청합니다.\\n3. 연차 사용 승인을 받습니다.\\n4. 연차 사용 기간을 업무 담당자와 공유합니다.\\n5. 사용한 연차 일수를 HR 시스템에 입력하고 완료 처리합니다.\", \"response_type\": \"gpt\", \"route_code\": null, \"route_name\": null, \"route_path\": null, \"route_type\": null}}'),
(99,'연차 사용 절차','1. 근무일 7일 이전에 연차 사용 신청서를 작성합니다.\n2. 상사의 승인을 받은 후, 인사팀에 제출합니다.\n3. 연차 일수만큼 휴가 계획을 조정하고 근태 관리 시스템에 반영합니다.\n4. 연차 사용 후에는 근태 관리 시스템을 통해 사용 내역을 확인합니다.',NULL,NULL,'gpt',NULL,'2025-06-11 07:50:57','2025-06-11 07:50:57','{\"status\": \"success\", \"data\": {\"response\": \"1. 근무일 7일 이전에 연차 사용 신청서를 작성합니다.\\n2. 상사의 승인을 받은 후, 인사팀에 제출합니다.\\n3. 연차 일수만큼 휴가 계획을 조정하고 근태 관리 시스템에 반영합니다.\\n4. 연차 사용 후에는 근태 관리 시스템을 통해 사용 내역을 확인합니다.\", \"response_type\": \"gpt\", \"route_code\": null, \"route_name\": null, \"route_path\": null, \"route_type\": null}}'),
(100,'영우랩스의 연차사용절차는?','1. 연차 사용 절차\n2. HR 시스템 로그인\n3. 메뉴에서 연차 신청 클릭\n4. 휴가 시작일과 종료일 선택\n5. 사용 일수 입력\n6. 사유 작성\n7. 결재자 지정 후 제출\n\n| 항목 | 내용 |\n|------|------|\n| HR 시스템 로그인 | 본인의 계정으로 로그인 |\n| 휴가 시작일과 종료일 선택 | 휴가를 원하는 시작일과 종료일을 캘린더에서 선택 |\n| 사용 일수 입력 | 사용할 연차 일수를 입력 |\n| 사유 작성 | 연차 사용 사유를 간단하게 작성 |\n| 결재자 지정 후 제출 | 상위자를 지정하여 결재 요청 후 제출 |',NULL,NULL,'gpt',NULL,'2025-06-11 07:52:20','2025-06-11 07:52:20','{\"status\": \"success\", \"data\": {\"response\": \"1. 연차 사용 절차\\n2. HR 시스템 로그인\\n3. 메뉴에서 연차 신청 클릭\\n4. 휴가 시작일과 종료일 선택\\n5. 사용 일수 입력\\n6. 사유 작성\\n7. 결재자 지정 후 제출\\n\\n| 항목 | 내용 |\\n|------|------|\\n| HR 시스템 로그인 | 본인의 계정으로 로그인 |\\n| 휴가 시작일과 종료일 선택 | 휴가를 원하는 시작일과 종료일을 캘린더에서 선택 |\\n| 사용 일수 입력 | 사용할 연차 일수를 입력 |\\n| 사유 작성 | 연차 사용 사유를 간단하게 작성 |\\n| 결재자 지정 후 제출 | 상위자를 지정하여 결재 요청 후 제출 |\", \"response_type\": \"gpt\", \"route_code\": null, \"route_name\": null, \"route_path\": null, \"route_type\": null}}'),
(101,'영우랩스의 연차사용절차는?','1. 상사에게 연차 사용 계획을 미리 협의하고 승인을 받습니다.\n2. HR 시스템을 통해 연차 사용 신청을 합니다.\n3. 연차 사용 시작일 하루 전까지 신청서를 제출합니다.\n4. 연차 사용 후 근태 관리 시스템에 반영되어야 합니다.\n5. 상황에 따라 추가 서류나 보고가 요구될 수 있습니다.\n\n| 항목 | 내용 |\n|------|------|\n| 신청 방법 | HR 시스템을 통한 온라인 신청 |\n| 필수 제출물 | 연차 사용 신청서 |\n| 유의 사항 | 연차 사용 시작일 1일 전까지 제출 필요 |',NULL,NULL,'gpt',NULL,'2025-06-11 07:53:53','2025-06-11 07:53:53','{\"status\": \"success\", \"data\": {\"response\": \"1. 상사에게 연차 사용 계획을 미리 협의하고 승인을 받습니다.\\n2. HR 시스템을 통해 연차 사용 신청을 합니다.\\n3. 연차 사용 시작일 하루 전까지 신청서를 제출합니다.\\n4. 연차 사용 후 근태 관리 시스템에 반영되어야 합니다.\\n5. 상황에 따라 추가 서류나 보고가 요구될 수 있습니다.\\n\\n| 항목 | 내용 |\\n|------|------|\\n| 신청 방법 | HR 시스템을 통한 온라인 신청 |\\n| 필수 제출물 | 연차 사용 신청서 |\\n| 유의 사항 | 연차 사용 시작일 1일 전까지 제출 필요 |\", \"response_type\": \"gpt\", \"route_code\": null, \"route_name\": null, \"route_path\": null, \"route_type\": null}}'),
(102,'재택근무 가이드가능한가요?','**재택근무 안내**\n\n1. **대상자**\n   - 특별한 사유가 없는 한 모든 임직원이 대상입니다.\n\n2. **업무 처리 방법**\n   - 회사 배정 노트북 또는 개인 장비를 이용하여 업무를 처리합니다.\n   - 업무용 소프트웨어는 VPN을 통해 접속하여 사용합니다.\n\n3. **연장근로 및 야간 근로**\n   | 유형 | 세부 내용 |\n   |------|-----------|\n   | 연장근로 | 상황에 따라 필요 시 연장근로를 인정합니다. |\n   | 야간 근로 | 야간에 업무를 처리해야 할 경우, 사전 협의 후 근무 가능합니다. |\n\n4. **보안 수칙**\n   - 개인 정보 유출 방지를 위해 업무 관련 자료는 암호화된 저장매체에 보관합니다.\n   - 외부에서의 접근을 막기 위해 와이파이 비밀번호를 주기적으로 변경합니다.\n\n5. **연차 및 휴가**\n   - 일반적인 근로규칙에 따라 연차 및 휴가 신청이 가능하며, 사전 협의 후 결정됩니다.\n\n6. **사내 의사소통**\n   - 업무 진행 상황 및 의견 공유를 위해 정기적인 온라인 미팅을 개최합니다.\n\n7. **근무 일시 및 기한**\n   - 재택근무 시작일과 종료일은 별도 안내되니 참고 바랍니다.',NULL,NULL,'gpt',NULL,'2025-06-11 08:00:16','2025-06-11 08:00:16','{\"status\": \"success\", \"data\": {\"response\": \"**재택근무 안내**\\n\\n1. **대상자**\\n   - 특별한 사유가 없는 한 모든 임직원이 대상입니다.\\n\\n2. **업무 처리 방법**\\n   - 회사 배정 노트북 또는 개인 장비를 이용하여 업무를 처리합니다.\\n   - 업무용 소프트웨어는 VPN을 통해 접속하여 사용합니다.\\n\\n3. **연장근로 및 야간 근로**\\n   | 유형 | 세부 내용 |\\n   |------|-----------|\\n   | 연장근로 | 상황에 따라 필요 시 연장근로를 인정합니다. |\\n   | 야간 근로 | 야간에 업무를 처리해야 할 경우, 사전 협의 후 근무 가능합니다. |\\n\\n4. **보안 수칙**\\n   - 개인 정보 유출 방지를 위해 업무 관련 자료는 암호화된 저장매체에 보관합니다.\\n   - 외부에서의 접근을 막기 위해 와이파이 비밀번호를 주기적으로 변경합니다.\\n\\n5. **연차 및 휴가**\\n   - 일반적인 근로규칙에 따라 연차 및 휴가 신청이 가능하며, 사전 협의 후 결정됩니다.\\n\\n6. **사내 의사소통**\\n   - 업무 진행 상황 및 의견 공유를 위해 정기적인 온라인 미팅을 개최합니다.\\n\\n7. **근무 일시 및 기한**\\n   - 재택근무 시작일과 종료일은 별도 안내되니 참고 바랍니다.\", \"response_type\": \"gpt\", \"route_code\": null, \"route_name\": null, \"route_path\": null, \"route_type\": null}}'),
(103,'연차사용절차는?','1. 연차 사용 절차\n2. 연차 신청은 최소 3일 전에 HR 시스템을 통해 제출해야 합니다.\n3. 상사 승인 후 연차가 확정되며, 연차 일정이 캘린더에 반영됩니다.\n4. 만약 긴급한 사유로 당일 연차를 사용해야 할 경우, 상황에 따라 HR과 상의하여 처리합니다.\n\n| 항목 | 내용 |\n|------|------|\n| 신청 기한 | 최소 3일 전 |\n| 신청 방법 | HR 시스템 제출 |\n| 승인 절차 | 상사 승인 필요 |\n| 긴급 신청 | HR 및 상사와 협의 후 처리 |',NULL,NULL,'gpt',NULL,'2025-06-11 08:23:08','2025-06-11 08:23:08','{\"status\": \"success\", \"data\": {\"response\": \"1. 연차 사용 절차\\n2. 연차 신청은 최소 3일 전에 HR 시스템을 통해 제출해야 합니다.\\n3. 상사 승인 후 연차가 확정되며, 연차 일정이 캘린더에 반영됩니다.\\n4. 만약 긴급한 사유로 당일 연차를 사용해야 할 경우, 상황에 따라 HR과 상의하여 처리합니다.\\n\\n| 항목 | 내용 |\\n|------|------|\\n| 신청 기한 | 최소 3일 전 |\\n| 신청 방법 | HR 시스템 제출 |\\n| 승인 절차 | 상사 승인 필요 |\\n| 긴급 신청 | HR 및 상사와 협의 후 처리 |\", \"response_type\": \"gpt\", \"route_code\": null, \"route_name\": null, \"route_path\": null, \"route_type\": null}}'),
