(207,'조직도','**조직도 안내**\n\n1. 부서\n    - 인사팀\n        - 팀장: 홍길동\n        - 신입사원 교육\n        - 인사정책 수립\n    - 영업팀\n        - 팀장: 박철수\n        - 영업 전략 수립\n        - 거래처 관리\n    - 개발팀\n        - 팀장: 김영희\n        - 소프트웨어 개발\n        - 기술 지원\n\n2. 하위 부서\n    - 영업지원팀\n        - 팀장: 이영자\n        - 견적 작성\n        - 계약 관리\n    - 시스템팀\n        - 팀장: 정기영\n        - 네트워크 관리\n        - 시스템 운영\n\n3. 인턴팀\n    - 팀장: 신인턴\n    - 인턴 업무 지원\n    - 교육 및 멘토링\n\n| 부서 | 팀원 수 | 업무 |\n|------|--------|------|\n| 인사팀 | 5명 | 신입사원 교육, 인사정책 수립 |\n| 영업팀 | 8명 | 영업 전략 수립, 거래처 관리 |\n| 개발팀 | 6명 | 소프트웨어 개발, 기술 지원 |\n| 영업지원팀 | 4명 | 견적 작성, 계약 관리 |\n| 시스템팀 | 3명 | 네트워크 관리, 시스템 운영 |\n| 인턴팀 | 2명 | 인턴 업무 지원, 교육 및 멘토링 |',NULL,NULL,'gpt',NULL,'2025-06-14 06:09:41','2025-06-14 06:09:41','{\"response\": \"**조직도 안내**\\n\\n1. 부서\\n    - 인사팀\\n        - 팀장: 홍길동\\n        - 신입사원 교육\\n        - 인사정책 수립\\n    - 영업팀\\n        - 팀장: 박철수\\n        - 영업 전략 수립\\n        - 거래처 관리\\n    - 개발팀\\n        - 팀장: 김영희\\n        - 소프트웨어 개발\\n        - 기술 지원\\n\\n2. 하위 부서\\n    - 영업지원팀\\n        - 팀장: 이영자\\n        - 견적 작성\\n        - 계약 관리\\n    - 시스템팀\\n        - 팀장: 정기영\\n        - 네트워크 관리\\n        - 시스템 운영\\n\\n3. 인턴팀\\n    - 팀장: 신인턴\\n    - 인턴 업무 지원\\n    - 교육 및 멘토링\\n\\n| 부서 | 팀원 수 | 업무 |\\n|------|--------|------|\\n| 인사팀 | 5명 | 신입사원 교육, 인사정책 수립 |\\n| 영업팀 | 8명 | 영업 전략 수립, 거래처 관리 |\\n| 개발팀 | 6명 | 소프트웨어 개발, 기술 지원 |\\n| 영업지원팀 | 4명 | 견적 작성, 계약 관리 |\\n| 시스템팀 | 3명 | 네트워크 관리, 시스템 운영 |\\n| 인턴팀 | 2명 | 인턴 업무 지원, 교육 및 멘토링 |\", \"type\": \"gpt\", \"route_code\": null, \"target_url\": null, \"button_text\": null, \"pattern_id\": null, \"pattern_text\": null, \"pattern_type\": null, \"response_type\": null}'),
(208,'조직도','**조직도 안내**\n\n조직도는 다음과 같습니다:\n1. 대표이사\n2. 경영지원본부\n3. 영업본부\n4. 인사총무본부\n5. 연구개발본부\n\n각 부서의 상세 구성원은 별도 문의 부탁드립니다.',NULL,NULL,'gpt',NULL,'2025-06-14 06:14:54','2025-06-14 06:14:54','{\"response\": \"**조직도 안내**\\n\\n조직도는 다음과 같습니다:\\n1. 대표이사\\n2. 경영지원본부\\n3. 영업본부\\n4. 인사총무본부\\n5. 연구개발본부\\n\\n각 부서의 상세 구성원은 별도 문의 부탁드립니다.\", \"type\": \"gpt\", \"route_code\": null, \"target_url\": null, \"button_text\": null, \"pattern_id\": null, \"pattern_text\": null, \"pattern_type\": null, \"response_type\": null}'),
(209,'회사소개','### 영우랩스 회사소개\n\n1. **회사 개요**\n    - **회사명**: 영우랩스\n    - **설립년도**: 2005년\n    - **대표이사**: 홍길동\n    - **사업 내용**: 소프트웨어 개발 및 컨설팅\n\n2. **경영 이념**\n    - **고객 가치 최우선**: 고객 만족을 위해 최선을 다함\n    - **혁신과 도전**: 끊임없는 혁신을 통해 성장\n    - **사회 공헌**: 지속 가능한 발전을 위한 사회 공헌 실천\n\n3. **조직 문화**\n    - **열린 소통**: 모든 구성원 간 소통 촉진\n    - **상호 존중**: 서로를 존중하고 배려하는 분위기 조성\n    - **성과 공유**: 성과를 함께 공유하고 인센티브 제공\n\n4. **수상 이력**\n    | 수상 내역 | 연도 |\n    |------------|------|\n    | 우수 기업상 | 2018년 |\n    | 우수 서비스상 | 2020년 |\n    | 우수 사회공헌 기업 | 2021년 |\n\n5. **사업 영역**\n    - 소프트웨어 개발\n    - 데이터 분석 및 인공지능\n    - 클라우드 컴퓨팅 솔루션\n\n이상으로 영우랩스의 간단한 회사소개였습니다. 추가 궁금한 사항이 있으시면 언제든지 문의해주세요.',NULL,NULL,'gpt',NULL,'2025-06-14 06:16:36','2025-06-14 06:16:36','{\"response\": \"### 영우랩스 회사소개\\n\\n1. **회사 개요**\\n    - **회사명**: 영우랩스\\n    - **설립년도**: 2005년\\n    - **대표이사**: 홍길동\\n    - **사업 내용**: 소프트웨어 개발 및 컨설팅\\n\\n2. **경영 이념**\\n    - **고객 가치 최우선**: 고객 만족을 위해 최선을 다함\\n    - **혁신과 도전**: 끊임없는 혁신을 통해 성장\\n    - **사회 공헌**: 지속 가능한 발전을 위한 사회 공헌 실천\\n\\n3. **조직 문화**\\n    - **열린 소통**: 모든 구성원 간 소통 촉진\\n    - **상호 존중**: 서로를 존중하고 배려하는 분위기 조성\\n    - **성과 공유**: 성과를 함께 공유하고 인센티브 제공\\n\\n4. **수상 이력**\\n    | 수상 내역 | 연도 |\\n    |------------|------|\\n    | 우수 기업상 | 2018년 |\\n    | 우수 서비스상 | 2020년 |\\n    | 우수 사회공헌 기업 | 2021년 |\\n\\n5. **사업 영역**\\n    - 소프트웨어 개발\\n    - 데이터 분석 및 인공지능\\n    - 클라우드 컴퓨팅 솔루션\\n\\n이상으로 영우랩스의 간단한 회사소개였습니다. 추가 궁금한 사항이 있으시면 언제든지 문의해주세요.\", \"type\": \"gpt\", \"route_code\": null, \"target_url\": null, \"button_text\": null, \"pattern_id\": null, \"pattern_text\": null, \"pattern_type\": null, \"response_type\": null}'),
