(258,'조직도','**조직도 안내**\n\n현재 영우랩스의 조직도는 다음과 같이 구성되어 있습니다:\n1. 대표이사\n2. 경영지원본부\n   - 총무팀\n   - 인사팀\n   - 회계팀\n3. 연구개발본부\n   - 연구1팀\n   - 연구2팀\n   - 연구3팀\n4. 영업본부\n   - 영업1팀\n   - 영업2팀\n5. 마케팅본부\n   - 온라인마케팅팀\n   - 오프라인마케팅팀\n\n각 부서는 역할과 책무를 수행하고 있으며, 조직도는 업무 효율성을 높이기 위해 계속 개선되고 있습니다.',NULL,NULL,'gpt',NULL,'2025-06-14 08:50:29','2025-06-14 08:50:29','{\"response\": \"**조직도 안내**\\n\\n현재 영우랩스의 조직도는 다음과 같이 구성되어 있습니다:\\n1. 대표이사\\n2. 경영지원본부\\n   - 총무팀\\n   - 인사팀\\n   - 회계팀\\n3. 연구개발본부\\n   - 연구1팀\\n   - 연구2팀\\n   - 연구3팀\\n4. 영업본부\\n   - 영업1팀\\n   - 영업2팀\\n5. 마케팅본부\\n   - 온라인마케팅팀\\n   - 오프라인마케팅팀\\n\\n각 부서는 역할과 책무를 수행하고 있으며, 조직도는 업무 효율성을 높이기 위해 계속 개선되고 있습니다.\", \"type\": \"gpt\", \"route_code\": null, \"route_type\": null, \"route_name\": null, \"route_path\": null, \"response_json\": {\"data\": {\"response\": \"**조직도 안내**\\n\\n현재 영우랩스의 조직도는 다음과 같이 구성되어 있습니다:\\n1. 대표이사\\n2. 경영지원본부\\n   - 총무팀\\n   - 인사팀\\n   - 회계팀\\n3. 연구개발본부\\n   - 연구1팀\\n   - 연구2팀\\n   - 연구3팀\\n4. 영업본부\\n   - 영업1팀\\n   - 영업2팀\\n5. 마케팅본부\\n   - 온라인마케팅팀\\n   - 오프라인마케팅팀\\n\\n각 부서는 역할과 책무를 수행하고 있으며, 조직도는 업무 효율성을 높이기 위해 계속 개선되고 있습니다.\", \"route_code\": null, \"route_type\": null, \"route_name\": null, \"route_path\": null, \"pattern_id\": null, \"pattern_text\": null, \"pattern_type\": null, \"response_type\": \"gpt\"}}}'),
