(260,'조정현 정보','### 조정현 정보 안내\n\n- 성명: 조정현\n- 소속: 영우랩스\n- 직책: 도우미 어시스턴트\n- 담당 업무: 고객 질문 응대, 정책 안내\n\n### 조정현의 업무\n\n1. 고객 질문에 대한 답변 제공\n2. 정책 안내 업무 수행\n\n### 조정현의 역량\n\n- 커뮤니케이션 능력\n- 문제 해결 능력\n- 정확한 정보 전달력\n\n### 조정현의 연차\n\n- 1년차 도우미 어시스턴트\n\n### 조정현의 근무 시간\n\n- 주 5일 근무\n- 오전 9시부터 오후 6시까지\n\n### 조정현의 근무 일지\n\n| 날짜       | 업무 내용                |\n|------------|-------------------------|\n| 2022.09.01 | 고객 문의 응대           |\n| 2022.09.02 | 정책 안내 업무 수행     |\n| 2022.09.03 | 회의 참석               |\n| 2022.09.04 | 업무 일지 작성           |\n| 2022.09.05 | 휴가                     |',NULL,NULL,'gpt',NULL,'2025-06-14 08:51:15','2025-06-14 08:51:15','{\"response\": \"### 조정현 정보 안내\\n\\n- 성명: 조정현\\n- 소속: 영우랩스\\n- 직책: 도우미 어시스턴트\\n- 담당 업무: 고객 질문 응대, 정책 안내\\n\\n### 조정현의 업무\\n\\n1. 고객 질문에 대한 답변 제공\\n2. 정책 안내 업무 수행\\n\\n### 조정현의 역량\\n\\n- 커뮤니케이션 능력\\n- 문제 해결 능력\\n- 정확한 정보 전달력\\n\\n### 조정현의 연차\\n\\n- 1년차 도우미 어시스턴트\\n\\n### 조정현의 근무 시간\\n\\n- 주 5일 근무\\n- 오전 9시부터 오후 6시까지\\n\\n### 조정현의 근무 일지\\n\\n| 날짜       | 업무 내용                |\\n|------------|-------------------------|\\n| 2022.09.01 | 고객 문의 응대           |\\n| 2022.09.02 | 정책 안내 업무 수행     |\\n| 2022.09.03 | 회의 참석               |\\n| 2022.09.04 | 업무 일지 작성           |\\n| 2022.09.05 | 휴가                     |\", \"type\": \"gpt\", \"route_code\": null, \"route_type\": null, \"route_name\": null, \"route_path\": null, \"response_json\": {\"data\": {\"response\": \"### 조정현 정보 안내\\n\\n- 성명: 조정현\\n- 소속: 영우랩스\\n- 직책: 도우미 어시스턴트\\n- 담당 업무: 고객 질문 응대, 정책 안내\\n\\n### 조정현의 업무\\n\\n1. 고객 질문에 대한 답변 제공\\n2. 정책 안내 업무 수행\\n\\n### 조정현의 역량\\n\\n- 커뮤니케이션 능력\\n- 문제 해결 능력\\n- 정확한 정보 전달력\\n\\n### 조정현의 연차\\n\\n- 1년차 도우미 어시스턴트\\n\\n### 조정현의 근무 시간\\n\\n- 주 5일 근무\\n- 오전 9시부터 오후 6시까지\\n\\n### 조정현의 근무 일지\\n\\n| 날짜       | 업무 내용                |\\n|------------|-------------------------|\\n| 2022.09.01 | 고객 문의 응대           |\\n| 2022.09.02 | 정책 안내 업무 수행     |\\n| 2022.09.03 | 회의 참석               |\\n| 2022.09.04 | 업무 일지 작성           |\\n| 2022.09.05 | 휴가              